The RegEx for a SQL date format could be: 

\d{4}-\d{2}-\d{2} 

This RegEx pattern matches a date in the format YYYY-MM-DD.

The following regular expression pattern may help in matching HTML tags that contain attributes and potentially JavaScript code within them:

&lt;[^\s&;]*=(?:'[^']*'|"[^"]*"|[^'">\s]+)*&gt;

This pattern starts with the opening tag '&lt;', followed by any characters that are not whitespace, '&' or ';', then an equal sign '=', and finally a value that can be enclosed in single quotes, double quotes, or be a non-quote value. The pattern ends with the closing tag '&gt;'. This should help in matching HTML tags with attributes and potential JavaScript code within them.

